import React from 'react';

const Notfoundpage = () => {
    return (
        <div style={{ textAlign: "center"}}>
            <h2>Страница не найдена! Перейти на <a href='/'>главную страницу</a></h2>
        </div>
    );
};

export default Notfoundpage;
